import React from "react";
import Cards from "./cards";

const Latest = (props) => {
  return (
    <div>
      <Cards
        img={props.img}
        id={props.id}
        title={props.original_title}
        original_language={props.original_language}
        vote_average={props.vote_average}
        overview={props.overview}
      />
    </div>
  );
};

export default Latest;
